import React from "react";
import { useAppSelector, useAppDispatch } from "./hooks";
import { changeDone, changeUserName, addTodo, deleteTodo, selectTodo, selectUserName } from "./slice";

export const TodoList: React.FC = () => {

    const todo = useAppSelector(selectTodo)
    const userName = useAppSelector(selectUserName)
    const dispatch = useAppDispatch();

    return (
        <div>
            user: {userName}
            {todo.map((todo, i) => <div key={i}>
                title: {todo.title},
                done: {todo.done ? <button onClick={() => dispatch(changeDone(i))}> "done" </button> : <button onClick={() => dispatch(changeDone(i))}>"not done"</button>}
            </div>)}
        </div>
    )
}
